import React from 'react';

const Home = () =>
{
    return(

      <div className="container">

      <Navbar />
      <br/>
      <Routes>
      <Route path="/about" exact element={<About/>} />
      <Route path="/feedback" exact element={<Feedback/>} />
      <Route path="/map" exact element={<Map/>} />
      <Route path="/settings" exact element={<Settings/>} />
      </Routes>

      </div>
    );
};
export default Home;
